import React from "react";
import "./assets/styles/pages/App.css";
import { Header, Banner, Footer, Shortener } from "./components/sections";

function App() {
  return (
    <div className="App">
      <div className="white-background">
        <Header />
        <Banner />
      </div>
      <div className="gray-background">
        <Shortener />
        <Footer />
      </div>
    </div>
  );
}

export default App;
